import React from 'react';
import PropTypes from 'prop-types';

class Card extends React.Component {
  render() {
    const {
      cardName,
      cardDescription,
      cardAttr1,
      cardAttr2,
      cardAttr3,
      /*       hasTrunfo, */
      cardImage,
      cardRare,
      cardTrunfo } = this.props;
    return (
      <div>
        <h2>{ cardName }</h2>
        <p>{cardDescription}</p>
        <img src={cardImage} ></img>
        <span>{cardAttr1}</span>
        <span>{cardAttr2}</span>
        <span>{cardAttr3}</span>
        <span>{cardRare}</span>
        <span>{cardTrunfo}</span>
      </div>
    )
  }
}

export default Card
